import React, { useEffect, useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography } from '@mui/material';
import axios from 'axios';

interface Criminal {
  id: number;
  first_name: string;
  last_name: string;
  criminal_id: string;
  risk_level: string;
  status: string;
}

const CriminalList: React.FC = () => {
  const [criminals, setCriminals] = useState<Criminal[]>([]);

  useEffect(() => {
    const fetchCriminals = async () => {
      try {
        const response = await axios.get('http://localhost:8000/criminals/');
        setCriminals(response.data);
      } catch (error) {
        console.error('Error fetching criminals:', error);
      }
    };

    fetchCriminals();
  }, []);

  return (
    <div>
      <Typography variant="h6" gutterBottom>
        Criminal Records
      </Typography>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Name</TableCell>
              <TableCell>Risk Level</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {criminals.map((criminal) => (
              <TableRow key={criminal.id}>
                <TableCell>{criminal.criminal_id}</TableCell>
                <TableCell>{`${criminal.first_name} ${criminal.last_name}`}</TableCell>
                <TableCell>{criminal.risk_level}</TableCell>
                <TableCell>{criminal.status}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default CriminalList;
